      "concentration": "Mechanical Engineering",
      "pronouns": "she/her/hers",
      "quote": "I think in STEM, and specifically in engineering or in computer science, it's not just that being male is the majority, but masculinity is part of it too. People assume that if you're a woman in STEM, then you have more traditionally masculine traits too. I feel like I've had to compromise on things and assert masculinity in these kinds of environments. Which I think should not be the case. And I think that, you know, engineering is for everyone. I feel like for me, I've always not only had to prove that I can do what it takes, but show that I can also be 'one of the guys.'",
