      "year": 2021,
      "concentration": "Applied Math",
      "pronouns": "she/her/hers",
      "quote": "Within the applied math courses that I've taken the collaboration is super strong. I've never gone through a course without having a pset group or at least one pset person. We like go to office hours together and we like grind it out at like 11:30pm. I've made some good friends through dying in difficult courses."
